window.bookSummaryJSON = "<p><b>He conquered her. Now he will claim her.</b></p> <p>When Rowan inherited control of her pack upon her father's death, she vowed never to marry, and many a suitor has since been sent home disappointed. But Alaric of Ravenscar is no suitor....</p> <p>He is a warlord, never defeated in battle, and he has come to take what he wants. He means to conquer not just Rowan's lands but her beautiful virgin body as well, and her efforts to defy him merely result in her being mounted and claimed with her well-spanked bare bottom still burning.</p> <p>Soon, Alaric will mark her as his mate, but first she will be thoroughly and shamefully mastered.</p> <p><b>Publisher's note:</b> <i>Warlord</i> includes spankings and sexual scenes. If such material offends you, please don't listen to this audiobook.</p>"; 
